import React from 'react';
import './Home.css';
import Header from '../../components/Header/Header';
import Footer from '../../components/Footer/Footer';
import bannière from '../../assets/IMG.png'
import Card from '../../components/Card/Card';
import Banner from '../../components/Banner/Banner'
import cards from '../../json/housing.json'

function Home() {

  const cardList = cards.map(card => (
    <Card key={card.id} id={card.id} title={card.title} description={card.description} cover={card.cover} />
  ))


  return (
    <div className="App">
      <Header />
      <section className='body'>
          <Banner src={bannière} alt='bannière' title="Chez vous,  et partout ailleurs"/>

        <div className='cardList'>
        {cardList}
        </div>
      </section>

      <Footer />
    </div>
  );
}

export default Home;
